import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { removeUserSession } from "./Utils/Common";
import { TimeoutLogic } from "./Utils/TimeoutLogic";

function Dashboard(props) {
  const [data, setData] = useState("");
  const navigate = useNavigate();

  const userdata = {
    student_admissions_id: 1013,
  };
  console.log(data);
  const token =
    "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJyZXN1bHQiOnsiaWQiOjEsIm5hbWUiOiJBZG1pbiIsImVtYWlsIjoiYWRtaW5AZ21haWwuY29tIiwiZW1haWxfdmVyaWZpZWRfYXQiOm51bGwsInJlbWVtYmVyX3Rva2VuIjpudWxsLCJjcmVhdGVkX2F0IjpudWxsLCJ1cGRhdGVkX2F0IjpudWxsLCJyb2xlIjoiYWRtaW4iLCJwYXNzd29yZF9kaWdlc3QiOm51bGx9LCJpYXQiOjE2Njc5ODQwOTksImV4cCI6MTY2Nzk5MTI5OX0.7rIRjAYxZIMPcZdmHOD6tqTehBV9GPQ2qXPszb4kkkM";

  const headers = {
    ContentType: "application/json",
    Authorization: `Bearer${token}`,
  };
  const getdata=()=>{axios
    .post(
      "https://5148-103-141-51-42.in.ngrok.io/api/v1/studentProfile",
      userdata,
      { headers: headers }
    )
    .then((res) => {
      setData(res.data.data[0]);
    });
  }
  useEffect(() => {
   getdata()
  },[]);
  console.log("value", data.DOB);

  const handleLogout = () => {
    removeUserSession();
    navigate("/");
  };

  return (
    <div className="container log bg-dark text-white">
      <h1>{data.DOB}</h1>
      Welcome to Dashboard !<br />
      <br />
      <input
        type="button"
        className=" btn btn-primary"
        onClick={handleLogout}
        value="Logout"
      />
      <TimeoutLogic />
    </div>
  );
}

export default Dashboard;
